import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
const e = React.createElement;
function App() {
  return (
    e('div',{className:'container'},
      e('div',{className:'row'},
        e('div',{className:'col-md-6 content-console'},
          e('textarea',{className:'textarea'},'hi')
          ),
        e('div',{className:'col-md-6 content-admin'},'B'),

      )
    )
  );
}

export default App;
